-  وظهر ميسي في حوار خص به موقع “جول” للحديث عن موقفه في برشلونة موضحًا أنه مرغم على البقاء مع الفريق لموسم آخر بعدما أخلف رئيس النادي وعده له بالسماح له بالرحيل بنهاية الموسم، وتمسكه بالحصول على الـ 700 مليون يورو، كما أكد أنه لن يلجأ أبدًا إلى الخيار الثاني بمقاضاة برشلونة ولن يقف ضد نادي عمره، كما وصفه، في المحكمة، مؤكدًا أن برشلونة منحه كل شئ ويكن له حبًا كبيرًا.

