-  نصح جريج برهالتر، المدير الفني لمنتخب أمريكا، كريستيان بوليسيتش، جناح فريق تشيلسي الإنجليزي، بالانتقال إلى برشلونة أو ريال مدريد.

-  النجم الأمريكي ظهر بشكل رائع مع البلوز منذ استئناف الدوري الإنجليزي عقب انتشار فيروس كورونا، حيث سجل 11 هدفًا وصنع 5 أهداف، في جميع البطولات.

-  وقال برهالتر في تصريحات عبر صحيفة “بيلد” الألمانية: “بوليسيتش قائد في تشيلسي في عمر 21 عامًا، لا يحدث في كثير من الأحيان أن يذهب لاعب من الدوري الألماني لنادٍ كبير في إنجلترا ويقنع هناك على الفور”.

🚨🚨مدرب أمريكا: بوليسيتش يمكنه اللعب في برشلونة أو ريال مدريد

-  وأضاف: “سرعان ما اعتاد كريستيان على السرعة والأسلوب الجسدي للعب في إنجلترا، إنه نموذج يُحتذى به لجميع اللاعبين الأمريكيين الآخرين في البوندسليجا، الذين هدفهم هو الدوري الإنجليزي الممتاز”.

-  وأكمل: “بوليسيتش مثالي للبلوز، كل الكرات الهجومية الخطيرة تمر من خلاله، فهو يتألق باعتباره هدافًا وصانعًا للألعاب، إذا حافظ كريستيان على هذا المستوى، يمكنه أيضًا اللعب لأكبر الأندية في العالم مثل بايرن أو برشلونة أو ريال مدريد دون أي مشاكل”.

-  جدير بالذكر أن اللاعب صاحب الـ21 عامًا كان كان قد انتقل إلى صفوف النادي اللندني في الصيف الماضي، قادمًا من بوروسيا دورتموند مقابل 58 مليون جنيه إسترليني.
