-  بات نادي برشلونة على مشارف التوقيع مع ممفيس ديباي، مهاجم ليون الفرنسي، بتعليمات من المدرب الجديد رونالد كومان، والذي يعرف نجم الطواحين الهولندية تمام المعرفة.

-  وبعد اجتماعات مكثفة جمعت وكيل أعمال ديباي بإدارة النادي الكتالوني، أصبح كل شيء مهيئاً لانتقال المهاجم الهولندي إلى البارسا، والتدرب مجدداً تحت قيادة رونالد كومان، والذي سبق له العمل معه في منتخب الطواحين.

🚨🚨ديباي قريب جداً من برشلونة:

-  وبحسب صحيفة “ماركا” الإسبانية، فإن ممفيس ديباي سيُصبح لاعباً جديداً في صفوف برشلونة، مقابل 25 مليون يورو، وذلك من أجل خلافة الأوروجوياني لويس سواريز، في هجوم البارسا بالموسم الجديد.

-  وسينضم ديباي إلى هجوم مكون من ميسي وأنسو فاتي وجريزمان وديمبيلي وترينكاو وكوتينيو وبريثويت، وبالتالي فإن مهمته في حجز مقعد أساسي لن تكون سهلة، حتى لو رحل لويس سواريز.

-  وكان ديباي قد علق على أخبار انتقاله للبارسا، حيث قال: “لدي علاقة جيدة للغاية مع رونالد كومان، الآن هو مدرب لبرشلونة، ولكني أركز بشدة مع ليون، وسعيد بما أحققه وأبذل قصارى جهدي لاستعادة مستواي”.
