-  يصر المدير الفني الجديد لنادي برشلونة الإسباني رونالد كومان على ضم مواطنه الهولندي جورجينيو فينالدوم، نجم نادي ليفربول الإنجليزي، إلى فريقه خلال الصيف الجاري.

-  وحسب صحيفة “موندو ديبورتيفو” الإسبانية، فإن المفاوضات بين برشلونة وليفربول ليست قوية حتى اللحظة، إلا أن رونالد كومان يبدو واضحًا تمامًا في رأيه بأن فينالدوم يعتبر قطعة رئيسية في خطته لإعادة بناء خط وسط النادي الكتالوني لتطبيق أسلوب لعبه.

-  وأوضحت الصحيفة أن هذا الاهتمام أوصله بالفعل المدرب الهولندي للاعبه السابق في منتخب الطواحين كما يصر كومان داخليًا على رغبته في الحصول على خدمات نجم الريدز الذي ساهم في الإطاحة بالبلوجرانا من دوري أبطال أوروبا الموسم قبل الماضي، حين سجل هدفين من أصل 4 أهداف على ملعب أنفيلد بلقاء إياب نصف النهائي.

🚨🚨كومان مقتنع أن نجم ليفربول سيكون لاعبًا رئيسيًا في برشلونة

-  وينتهي عقد فينالدوم مع ليفربول في 30 يونيو القادم، إذ يحق له التفاوض مع أي ناد في يناير، فيما لم يحسم مستقبله بعد مع بطل الدوري الإنجليزي الممتاز، الذي انضم إليه في 2016 قادمًا من نيوكاسل الإنجليزي مقابل 30 مليون يورو.

-  ويحظى فينالدوم بإعجاب شديد من قبل كومان والذي تابع مسيرة اللاعب وتطوره على مدار السنوات ولديه اقتناع كامل بإمكانية أن يصبح لاعبًا رئيسيًا في تشكيلة برشلونة.

-  وفي ظل رحيل إيفان راكيتيتش وكذلك الرحيل المنتظر لأرتورو فيدال، يرى كومان أن فينالدوم بإمكانه القيام بعملية الضغط والزيادة الهجومية، كما يملك اللاعب معرفة قوية بالمستوى العالي للكرة الأوروبية نظرًا لخبرته مع ليفربول، كما لديه شخصية تعشق الفوز وهي محل تقدير كبير من كومان.
