rii am văzut viitorul, nu stiam ce zice, ce vrea sa-mi transmită. Peste valuri învolburate, culori diverse, văd un viitor, o cale plină de dezamăgiri, vise împlinite și bucurii. Vedeam secundele cum se scurg simplu clipind fără sa-ți dai seama, între timp pe când eram mic copil aud, ca nimeni și nimic nu e permanent, că totul se “limpezește”, toți și toate sunt duși departe de valuri nonconformiste cu ale lor personalități proprii, se duc departe de al meu suflet.

Am înotat alături de visele și forțele mele, spre următoarea secunda.”

